import React from 'react';

const styles: any = {
  margin: '0 auto',
  display: 'flex'
}

function unOrderedList(): any {
  return (
      <ul style={styles.margin}>
        <li>1</li>
        <li>2</li>
        <li>3</li>
        <li>4</li>
      </ul>
  );
}

const App = (): any => {
  return (
    <div style={styles.display}>

    </div>
  );
}

export default App;
